import React from "react";
import "./Plan.css";


function Plan(){
    return(
        <div className="plan">
            <div>
                <span className="stoke-text">Ready to start</span>
                <span>Your journey</span>
                <span> Now withus</span>
            </div>
        </div>
    );
}
export default Plan;
